x, x_data = numpy.ones(100), 'data'
hash_config = [('firstHash', ['1', '2', '3', '4']), ('secondHash', ['10',
    '20', '3', '4', '50'])]
for hash_name, bucket_keys in hash_config:
    for bucket_key in bucket_keys:
        self.storage.store_vector(hash_name, bucket_key, x, x_data)
for hash_name, bucket_keys in hash_config:
    self.assertSequenceEqual(sorted(self.storage.get_all_bucket_keys(
        hash_name)), sorted(bucket_keys))
